import React from "react";
export default class Home extends React.Component {
    constructor(){
        fetch("http://localhost:8000/api/home").then(res => res.json()).then((result) => {
            console.log(result);
          this.setState({
            isLoaded: true,
            data: result
          });
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
      console.log("constructed")

    }
    componentDidMount(){
        
      console.log("mounted");
    }
   
    componentDidUpdate(){
        console.log("updated");
    }
    render(){
        return(
            <div></div>
        )
    }
}
